import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import '@fortawesome/fontawesome-free/css/all.min.css';

import Login from './components/Login';
import Register from './components/Register';
import CustomerDashboard from './components/CustomerDashboard';
import AdminDashboard from './components/AdminDashboard';
import CompleteProfile from './components/CustomerProfile';
import SellGoat from './components/SellGoat'; // Import SellGoat component
import MyGoats from './components/Mygoats'; // Import MyGoats component
import BuyGoats from './components/BuyGoats'; // Import BuyGoats component
import CustomerLayout from './components/CustomerLayout';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/customer-dashboard" element={<CustomerDashboard />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/complete-profile" element={<CompleteProfile />} />
        <Route path="/sell-goat" element={<SellGoat />} /> {/* Route for adding/editing goats */}
        <Route path="/my-goats" element={<MyGoats />} /> {/* Route for viewing listed and purchased goats */}
        <Route path="/buy-goats" element={<BuyGoats />} /> {/* Route for purchasing goats */}
        <Route path="Customer-Layout" element={<CustomerLayout />} />
      </Routes>
    </Router>
  );
}

export default App;
